import logo from "./logo.svg";
import "./App.css";
import { Bar } from "react-chartjs-2";

function App() {
  const options = {
    // graph to be responsive
    responsive: true,
    //different plugins
    plugins: {
      title: {
        display: true,
        text: "Bar Chart",
      },
      legend: {
        position: "bottom",
      },
    },
  };
  // data format
  const data = {
    // represent column names
    labels: ["dfs", "dfs"],
    // we can use multiple datasets
    datasets: [
      {
        label: "Label name",
        data: [],
        backgroundColor: "red",
      },
    ],
  };
  return (
    <div className="App">
      <Bar options={options} data={data} />
    </div>
  );
}

export default App;
